import React from 'react';

import TimerSessionViewDate from '../../TimerSessionViewDate';

class TimerSessionsView extends React.Component {

  onSelectedDate(date) {
    console.log(date);
  }

  render() {
    return(
      <div>
        <TimerSessionViewDate onSelectedDate={this.onSelectedDate.bind(this)} />
        {this.props.sessions && this.props.sessions.map((session, key) => {
          return <li key={key}>
              {session.name} - {session.time} - {session.createdAt}
            </li>
        })}
      </div>
    )
  }

}

export default TimerSessionsView
